        e.exports = JSON.parse('{"metaTitle":"Panuntunan ng Serbisyo | ESC ","metaDescription":"Mangyaring basahin nang mabuti ang mga tuntunin ng serbisyong ito. Sa pamamagitan ng pag-access o paggamit ng aming mga serbisyo, sumasang-ayon kang sumailalim sa mga tuntunin ng serbisyong ito at sa lahat ng tuntuning isinama sa pamamagitan ng sanggunian.","heading":"Panuntunan ng Serbisyo","content":["Mangyaring basahin nang mabuti ang mga tuntunin ng serbisyong ito.","SA PAMAMAGITAN NG PAG-ACCESS O PAGGAMIT NG AMING MGA SERBISYO, SUMASANG-AYON KANG SUMAILALIM SA MGA TUNTUNIN NG SERBISYONG ITO AT SA LAHAT NG TUNTUNING ISINAMA SA PAMAMAGITAN NG SANGGUNIAN.","Ang Mga Tuntunin ng Serbisyong ito at anumang mga tuntuning tahasang isinama dito (\\"Panuntunan\\") ilapat sa iyong pag-access at paggamit ng lahat ng mga serbisyo (aming \\"Serbisyo\\") ibinigay ng Nearblocks.com (\\"Kompanya,\\" \\"we,\\" or \\"us\\")"],"points":[{"heading":"1. ELIGIBILITY","content":["Kinakatawan at ginagarantiyahan mo na ikaw: (a) ay nasa legal na edad upang bumuo ng isang umiiral na kontrata; (b) ay hindi pa nasuspende o naalis sa paggamit ng aming Mga Serbisyo; at (c) ay may buong kapangyarihan at awtoridad na pumasok sa kasunduang ito sa paggawa nito ay hindi lalabag sa anumang iba pang kasunduan kung saan ikaw ay isang partido.","Kung nag rerehistro ka para gamitin ang Mga Serbisyo sa ngalan ng isang legal na entity, lalo mong kinakatawan at ginagarantiyan iyon (i) ang naturang legal na entity ay nararapat na organisado at wastong umiiral sa ilalim ng mga naaangkop na batas ng hurisdiksyon ng organisasyon nito, at (ii) ikaw ay nararapat na pinahihintulutan ng naturang legal na entity na kumilos sa ngalan nito."]},{"heading":"2. PAGTITIWALA NG MGA SERBISYO","content":["Maaari naming, sa aming sariling pagpapasya at walang pananagutan sa iyo, mayroon man o walang paunang abiso at anumang oras, baguhin o ihinto, pansamantala o permanente, anumang bahagi ng aming Mga Serbisyo."]},{"heading":"3. ASSUMPTION OF RISK","content":["Kinikilala mo at sumasang-ayon na may mga panganib na nauugnay sa paggamit ng isang serbisyong nakabatay sa Internet kabilang ang, pero hindi limitado sa , ang panganib ng pagkabigo ng hardware, software at mga koneksyon sa Internet, ang panganib ng malisyosong pagpapakilala ng software, at ang panganib na ang mga ikatlong partido ay maaaring makakuha ng hindi awtorisadong pag-access sa impormasyong naka imbak.","Kinikilala mo at sumasang-ayon na ang Kumpanya ay hindi mananagot para anumang mga pagkabigo sa komunikasyon, mga pagkagambala, mga pagkakamali, mga pagbaluktot o pagkaantala na maari mong maranasan kapag ginagamit ang Mga Serbisyo, gayunpaman sanhi. Walang pananagutan ang kumpanya at hindi mananagot sa anumang pagkalugi, mga pinsala o paghahabol na nagmumula sa paggamit n gaming Mga Serbisyo, kasama ang , pero hindi limitado sa , anumang pagkalugi, pinsala o paghahabol."]},{"heading":"4. MGA SERBISYO AT NILALAMAN NG THIRD PARTY","content":["Sa paggamit ng aming Mga Serbisyo, maaari kang tumingin ng nilalaman o gumamit ng mga serbisyong ibinigay ng mga ikatlong partido, kabilang ang mga link sa mga web page at mga serbisyo ng naturang mga partido (\\"Nilalaman ng Third-Party\\").","Hindi natin kontrolado, mag-endorso o magpatibay ng anumang Nilalaman ng Third-Party at walang pananagutan para sa Nilalaman ng Third-Party, kasama ang, walang limitasyon, material na maaring mapanlinlang, hindi kompleto, mali, nakakasakit, malaswa o kung hindi man ay hindi kanais-nais sa iyong hurisdiskyon.","At saka, ang iyong pakikitungo sa negosyo o pakikipag-ugnayan sa naturang mga ikatlong partido ay sa pagitan mo at ng mga ikatlong partido lamang. Kami ay hindi mananagot o mananagot para sa anumang pagkawala o pinsala ng anumang uri na natamo bilang resulta ng anumang naturang mga pakikitungo, at naiintindihan mo na ang iyong paggamit ng Third-Party Content, at ang iyong pakikipag-ugnayan sa mga ikatlong partido, ay nasa iyong sariling peligro."]},{"heading":"5. MATANGGAP NA PAGGAMIT","content":["Kapag ina-access o ginagamit ang Mga Serbisyo, sumasang-ayon ka na hindi ka lalabag sa anumang batas, kontrata, intelektwal na pag-aari o iba pang karapatan ng ikatlong partido o umawa ng isang tort, at ikaw ang tanging responsable para sa iyong pag-uugali habang ginagamit an gamin Mga Serbisyo. Hindi mo dapat:","Gamitin ang aming Mga Serbisyo sa anumang paraan na maaaring makagambala, makagambala, negatibong nakakaapekto o makahadlang sa iba pang mga user na ganap na tangkilikin an gaming Mga Serbisyo, o maaaring makapinsala, ma dis-able, labis na pasanin o makapinsala sa paggana n gaming Mga Serbisyo sa anumang paraan;","Gamitin an gaming Mga Serbisyo para magbayad, suportahan o kung hindi man ay makisali a anumang ilegal na aktibidad, kabilang ang, ngunit hindi limitado sa ilegal na pagsusugal, pandaraya, money-laundering, o mga aktibidad ng terorista;","Gumamit ng anumang robot, spider, crawler, scraper, o iba pang awtomatikong paraan o interface na hindi amin ibinigay para ma access ang aming Mga Serbisyo o kumuha ng data.;","Makipagugnayan sa Automated Data Collection (pag-scrape) maliban kung ang naturang Automated Date Collection ay nakakulong lamang sa search indexing para sa display sa Internet;","Gamitin o subukang gumamit ng account ng ibang user nang walang pahintulot;","Subukang iwasan ang anumang mga diskarte sa pag filter ng nilalaman na ginagamit naming, o subukang i-access ang anumang serbisyo o lugar ng aming Mga Serbisyo na hindi ka awtorisadong i-access;","Ipakilala sa Mga Serbisyo ang anumang virus, Trojan worm, logic bomb o iba pang mapaminsalang materyal;","Bumuo ng anumang third-party na application na nakikipag-ugnayan sa aming Mga Serbisyo nang wala an gaming paunang nakasulat na pahintulot;","Magbigay ng mali, hindi tumpak, o mapanlinlang na impormasyon; at","Hikayatin o hikayatin ang sinumang ikatlong partido na makisali sa alinman sa mga aktibidad na ipanagbabawal sa ilalim ng Seksyon na ito."]},{"heading":"6. NILALAMAN NG GINAWA NG USER","content":["6.1. Responsibilidad para sa Nilalaman na Binuo ng Gumagamit \u2013 Ikaw ang tanging may pananagutan para sa nilalaman ng, at para sa anumang pinsala na nagreresulta mula sa, anumang Nilalaman na Binuo ng User na iyong naipost, ina-upload, na-link o kung hindi man ay ginagawang available sa pamamagitan ng Serbisyo, anuman ng anyo nito nilalaman. Hindi kami mananagot para sa anumang pampublikong pagpapakita o maling paggamit ng iyong Nilalaman na Binuo ng User. Mayroon kaming karapatan (bagaman hindi obligasyon) na tanggihan o alisin ang anumang Nilalaman na Binuo ng User na, sa aming sariling paghuhusga ay lumalabag sa anumang mga tuntunin o patakaran ng Nearblocks.","6.2. Pagmamay-ari ng Nilalaman at Karapatang Mag-post \u2013 Kung nagpopost ka ng anumang bagay na hindi pagmamay-ari ng mga karapatan, sumasang-ayon ka na ikaw ay may pananagutan para sa anumang Nilalaman ng iyong post; na magsusumite ka lamang ng Nilalaman na may karapatan ang mag-post; at na ganap kang susunod sa anumang mga lisensya g third party na nauugnay sa Nilalaman na iyong ipo-post.","6.3. Pagbibigay ng Lisensya sa Amin- Kailangan naming ng legal na karapatang gawin ang mga bagay tulad ng pag-host ng Iyong Nilalaman, ipublish ito, at ibahagi ito. Binibigyan mo kami at ang aming mga legal na kahalili ng karapatang mag-imbak, mag-parse, at magpakita ng iyong nilalaman, at gumawa ng mga hindi sinasadyang kopya kung kinakailangan upang maibigay ang Website at maibigay ang serbisyo.","6.4. Mga Karapatan sa Moral \u2013 Pinapatili mo ang lahat ng karapatang moral sa Iyong Nilalaman na iyong ina-upload, na-publish, o isinumite sa anumang bahagi ng Serbisyo, kabilang ang mga karapatan ng integridad at pagpapatungkol. Gayunpaman, isinusuko mo ang mga karapatang ito at sumasang-ayon na huwag igiit ang mga ito laban sa amin, upang bigyang-daan kami na makatwirang gamitin ang mga karapatang ipinagkaloob sa Seksyon 6.3.","6.5. Sa lawak na ang kasunduang ito ay maipagpatupad ng naaangkop na batas, binibigyan mo ang Nearblocks ng mga karapatang kailangan naming gamitin ang iyong nilalaman nang walang pagpapatungkol at upang gumawa ng mga makatwirang pagbagay ng iyong nilalaman kung kinakailangan upang maibigay ang Website at maibigay ang serbisyo."]},{"heading":"7. MGA COPYRIGHTS AT IBA PANG MGA KARAPATAN SA INTELEKTWAL NA PAG-AARI","content":["Maliban kung iba ang ipinahiwatig sa amin, lahat ng copyright at iba pang mga karapatan sa intelektwal na pag-aari sa lahat ng nilalaman at iba pang mga materyal na nilalaman sa aming website o ibinigay na may kaugnayan sa Mga Serbisyo, kabilang ang, nang walang limitasyon, ang logo ng Kumpanya o Kumpanya at lahat ng disenyo, teksto graphics, larawan, impormasyon, data, software, sound file, iba pang mga file at ang pagpili at pagsasaayos nito (collectively, \\"Company Materials\\") ay pagmamay-ari ng Kumpanya o ng aming mga tagapaglisensya o mga supplier at pinoprotektahan ng mga batas sa copyright at iba pang mga batas sa karapatan  intelektwal na ari-arian.","Ang hindi awtorisadong paggamit at/o pagdoble ng materyal na ito nang walang malinaw at nakasulat na pahintulot mula sa may-akda at/o may-ari ng site na ito ay mahigpit na ipinagbabawal. Maaaring gumamit ng mga sipi at link, sa kondisyon na ang buo at malinaw na kredito ay ibinigay sa Nearblocks.com na may naaangkop at tiyak na direksyon sa orihinal na nilalaman."]},{"heading":"8. MGA TRADEMARK","content":["\\"Nearblocks\\" ang logo ng Kumpanya, at anumang iba pang pangalan ng produkto o serbisyo ng Kumpanya, logo o slogan na maaaring lumabas sa aming Mga Serbisyo ay mga trademark ng Kumpanya at hindi maaring kopyahin, gayahin o gamitin, nang buo o bahagi, nang wala ang aming paunang nakasulat na pahintulot.","Hindi ka gagamit ng anumang trademark, pangalan ng produkto o serbisyo ng Kumpanya nang wala ang aming paunang nakasulat na pahintulot, kasama nang walang limitasyon ang anumang metatag o iba pang \\"Nakatagong Teksto\\" paggamit ng anumang trademark, produkto o pangalan ng serbisyo ng Kumpanya. Bilang karagdagan, ang hitsura at pakiramdam n gaming Mga Serbisyo, kabilang ang lahat ng header page, custom na graphics, icon ng button at script, ay ang marka ng serbisyo, trademark at/o trade dress ng Kumpanya at hindi maaaring kopyahin, gayahin o gamitin, sa kabuuan o sa bahagi nang wala ang aming paunang nakasulat na pahintulot.","Ang lahat ng iba pang trademark, rehistradong trademark, pangalan ng produkto at pangalan ng kumpanya o logo na binanggit sa pamamagitan ng Aming Serbisyo ay pag-aari ng kani-kanilang mga may-ari. Ang patukoy sa anumang mga produkto, serbisyo, proseso o iba pang impormasyon, ayon sa pangalan, trademark, tagagawa, supplier o kung hindi man ay hindi bumubuo o nagpapahiwatig ng pag-endorso, sponsorship o reko mendasyon sa amin."]},{"heading":"9. SUSPENSYON; PAGTATAPOS","content":["Kung sakaling magkaroon ng anumang Force Majeure Event, paglabag sa Mga Tuntuning ito, o anumang iba pang kaganapan na gagawing hindi makatwiran sa komersyo ang probisyon ng Mga Serbisyo para sa Kumpanya, maaari naming, sa aming pagpapasya at walang pananagutan sa iyo, mayroon man o walang paunang abiso, suspindihin ang iyong access sa lahat o isang bahagi ng aming Mga Serbisyo.","Maaari naming wakasan ang iyong pag-access sa Mga Serbisyo sa aming sariling paghuhusga, kaagad at nang alang paunang abiso, at tanggalin o I-deactivate ang iyong Account at lahat ng nauugnay na impormasyon at mga file sa naturang account nang walang pananagutan sa iyo, kabila ang, halimbawa, kung sakaling lumabag ka, anumang termino ng Mga Tuntuning ito."]},{"heading":"10. PAHAYAG NG COOKIE","content":["Gumagamit ang site na ito ng cookies. Ang cookies ay maliliit na text file na inilalagay sa iyong computer ng mga website na binibisita mo. Malawakang ginagamit ang mga ito upang gawing gumana ang mga website, o gumana nang mas mahusay, gayundin upang magbigay ng impormasyon sa mga may-ari ng site. Karaniwang nakaimbak ang mga cookies sa hard drive ng iyong computer.","Ang impormasyon nakolekta mula sa cookies ay ginagamit naming upang suriin ang pagiging epektibo n gaming Site, pag-aralan ang mga uso, at pamahalaan ang platform. Ang impormasyong nakolekta mula sa cookies ay nagbibigay-daan sa amin pang matukoy ang mga bagay kung aling mga bahagi ng aming Site ang pinakamadalas binibisita sa pag-access sa aming Site. Sa kaalamang ito, mapapabuti naming ang kalidad ng iyong karanasan sa platform sa pamamagitan ng pagkilala at paghahatid ng higit pa sa mga pinaka gustong feature at impormasyon, gayundin sa paglutas ng mga problema sa pag-access. Gumagamit din kami cookies at/o isang teknolohiyang kilala bilang mga web bug o malinaw na gif, na karaniwang naka-imbak sa mga email upang matulungan kaming kumpirmahin ang iyong pagtanggap ng, at pagutugon sa, aming mga email at upang bigyan ka ng mas personalized na karanasan kapag ginagamit ang aming Site.","Gumagamit din kami ng (mga) third party na service provider, para tulungan kaming mas maunawaan ang paggamit n gaming Site. An gaming (mga) service provider ay maglalagay ng cookies sa hard drive ng iyong computer at makakatanggap ng impormasyong pipiliin naming na magtuturo  sa amin sa mga bagay tulad ng kung paano nagna-navigate ang mga bista sa aming site, kung anong mga pahina ang bina-browse at pangkalahatang impormasyon ng transaksyon. Sinusuri ng aming (mga) service provider ang impormasyong ito ay binibigay kami ng pinagsama-samang mga ulat. Ang impormasyon at pagsusuri na ibinigay ng aming (mga) service provider ay gagamitin upang tulungan kaming mas maunawaan ang mga interes ng aming mga bisita sa aming Site at kung paano mas mahusay na mapagsilbihan ang mga interes na iyon. Ang impormasyong nakolekta n gaming (mga) service provider ay maaaring maiugnay at isama sa impormasyong kinolekta naming tungkol sa iyo habang ginagamit mo ang platform. An gaming (mga) service provider ay pinaghihigpitan ayon sa kontrata mula sa paggamit ng impormasyong natatanggap nila mula sa aming Site maliban sa pagtulong sa amin.","Ang iyong patuloy na paggamit ng site na ito, pati na rin ang anumang kasunod na paggamit, ay ituturing bilang iyong pagpayag sa cookies na nakaimbak sa iyong device."]},{"heading":"11. PATAKARAN SA PRIVACY","content":["Pakitignan ang aming detalyadong Patakaran sa Privacy."]},{"heading":"12. DISCLAIMER NG WARRANTY","content":["(a) HANGGANG SA MAXIMUM NA LABAS NA PINAHINTULUTAN SA ILALIM NG NAAANGKOP NA BATAS, AT MALIBAN SA TAHASANG IBINIGAY SA KASLITAN SA ISANG PAGSULAT NAMIN, ANG ATING MGA SERBISYO AY BINIGAY SA ISANG \\"AS IS\\" AND \\"AS AVAILABLE\\" BATAY SA PINAKAMAHUSAY NA SAKOP NA PINAHIHINTULUTAN SA ILALIM NG NAAANGKOP NA BATAS. HAYAG NAMIN NA TINATAWAN, AT INIWALA MO, ANG LAHAT NG WARRANTY NG ANUMANG URI, IPINAHAYAG MAN O IPINAHIWATIG NA MGA WARRANTY NG KAKAYKAL, KAANGKUPAN PARA SA ISANG PARTIKULAR NA LAYUNIN, PAMAGAT, AT HINDI PAGSASABALA SA PAGSUNOD. AT MGA MATERYAL NA NILALAMAN DITO.","(b) INAANGIN MO NA ANG IMPORMASYON NA ITINATAY MO O ILIPAT SA PAMAMAGITAN NG ATING MGA SERBISYO AY MAAARING MAGING DI-MABALIK NA MAWALA O MABALI O PANSAMANTALA HINDI MAGAMIT DAHIL SA IBA\'T IBANG DAHILAN, KASAMA ANG MGA PAGKAKABIGO NG SOFTWARE, MGA PAGBABAGO NG PROTOCOLEDUSTRED, PAGBABAGO NG PROTOCOLEDUSTRAGE, INTERYOR NA PAGBABAGO. HINDI NA-SCHEDULE MAINTENANCE, O IBA PANG DAHILAN SA LOOB O LABAS NG ATING KONTROL. IKAW LAMANG ANG RESPONSIBILIDAD PARA SA PAGBA-back up at PAGPAPANATILI NG MGA DUPLICATE COPY NG ANUMANG IMPORMASYON NA IINISIMBOK O INILIPAT MO SA PAMAMAGITAN NG ATING MGA SERBISYO."]},{"heading":"13. LIMITASYON NG PANANAGUTAN","content":["MALIBAN KUNG KAIBIGAN NG BATAS, KAHIT KAHIT KAHIT KAHIT KAHIT KAHIT ANANG KUMPANYA, ANG ATING MGA DIREKTOR, MIYEMBRO, EMPLEYADO O AHENTE AY MANANAGOT PARA SA ANUMANG ESPESYAL, DI DIREKTA O KINAHIHINUNGANG MGA PINSALA, O ANUMANG IBA PANG MGA PINSALA NG ANUMANG URI, HINDI KASAMA SA ANUMANG URI, HINDI KASAMA. NG KITA O PAGKAWALA NG DATA, SA AKSYON MAN SA KONTRATA, TORT (KASAMA NGUNIT HINDI LIMITADO SA kapabayaan) O IBA PA, NA NAGMULA SA O SA ANUMANG PARAAN NA KAUGNAY SA PAGGAMIT O KAKAYAHANG GAMITIN ANG ATING MGA SERBISYO O ANG KAGAMITANG KOMPANYA. WALANG LIMITASYON ANUMANG MGA PINSALA NA DULOT NG O RESULTA SA PAGTITIWALA NG ANUMANG USER SA ANUMANG IMPORMASYON NA NAKUHA MULA SA KUMPANYA, O NA RESULTA SA MGA PAGKAKAMALI, PAGKAKAMALI, PAGGALANG, PAGBUBURSA NG MGA FILE O EMAIL, ERRRORS, PAGKAWALANG-AAN NG VIRUS, PAGKAWALANG-ALANG NG VIRUS, PAGKAWALANG SA PAG-AARAL, PAGKAWALANG SA PAG-AARAL NG PAGGANAP, RESULTA MAN O HINDI MULA SA ISANG FORCE MAJEURE EVENT, PAGBIGO SA KOMUNIKASYON, PAGNANAKAW, PAGSISIRA O HINDI AUTHORIZED ACCESS SA MGA RECORD, PROGRAMA, O SERBISYO NG KOMPANYA."]},{"heading":"14. INDEMNITY","content":["Sumasang-ayon kang ipagtanggol, bayaran at i-hold ang hindi nakakapinsalang Kumpanya (at bawat isa sa aming mga opisyal, direktor, miyembro, empleyado, ahente at kaanib) mula sa anumang paghahabol, kahilingan, aksyon, pinsala, pagkawala, gastos o gastos, kasama nang walang limitasyon ang mga makatwirang bayad sa abogado , na nagmumula o nauugnay sa:","(a) ang iyong paggamit ng, o pag-uugali na may kaugnayan sa, aming Mga Serbisyo;","(b) anumang Feedback na ibibigay mo;","(c) ang iyong paglabag sa Mga Tuntuning ito; o","(d) ang iyong paglabag sa anumang mga karapatan ng sinumang ibang tao o entity."]},{"heading":"15. MISCELLANEOUS","content":["15.1. Buong Kasunduan; Hanay ng una. Ang Mga Tuntuning ito ay naglalaman ng buong kasunduan, at pinapalitan ang lahat ng nauna at kasabay na pagkakaunawaan sa pagitan ng mga partido tungkol sa Mga Serbisyo. Hindi binabago ng Mga Tuntuning ito ang mga tuntunin o kundisyon ng anumang iba pang elektronik o nakasulat na kasunduan na maaaring mayroon ka sa Kumpanya para sa Mga Serbisyo o para sa anumang iba pang produkto o serbisyo ng Kumpanya o kung hindi man. Kung sakaling magkaroon ng anumang salungatan sa pagitan ng Mga Tuntuning ito at ng anumang iba pang kasunduan na maaaring mayroon ka sa Kumpanya, ang mga tuntunin ng ibang kasunduan na iyon ay makokontrol lamang kung ang Mga Tuntuning ito ay partikular na natukoy at ipinahayag na na-override ng naturang iba pang kasunduan.","15.2. Susog. Inilalaan namin ang karapatang gumawa ng mga pagbabago o pagbabago sa Mga Tuntuning ito sa pana-panahon, sa aming sariling paghuhusga. Magiging epektibo kaagad ang mga Binagong Tuntunin sa petsa na mai-post ang mga ito sa Mga Serbisyo maliban kung iba ang sasabihin namin sa pamamagitan ng aming paunawa sa naturang mga nabagong Tuntunin. Ang anumang mga nabagong Tuntunin ay maaangkop sa paggamit ng Mga Serbisyo pagkatapos na maging epektibo ang mga naturang pagbabago. Ang iyong patuloy na paggamit ng Mga Serbisyo kasunod ng petsa ng bisa ng naturang mga pagbabago ay bubuo ng iyong pagtanggap sa mga naturang pagbabago. Kung hindi ka sumasang-ayon sa anumang binagong Mga Tuntunin, dapat mong ihinto ang paggamit ng Mga Serbisyo.","15.3. Waiver. Ang aming kabiguan o pagkaantala sa paggamit ng anumang karapatan, kapangyarihan o pribilehiyo sa ilalim ng Mga Tuntuning ito ay hindi gagana bilang isang pagwawaksi nito.","15.4. Pagkahihiwalay. Ang kawalan ng bisa o hindi maipapatupad ng alinman sa Mga Tuntuning ito ay hindi makakaapekto sa bisa o kakayahang maipatupad ng anupamang iba sa Mga Tuntuning ito, na lahat ay mananatiling ganap at may bisa.","15.5. Mga Pangyayaring Force Majeure. Ang kumpanya ay hindi mananagot para sa anumang pagkawala o pinsala na magmumula sa anumang kaganapan na lampas sa makatwirang kontrol ng Kumpanya, kabilang ang, ngunit hindi limitado sa, baha, pambihirang kondisyon ng panahon, lindol, o iba pang pagkilos ng Diyos, sunog, digmaan, insureksyon, riot, alitan sa paggawa , aksidente, aksyon ng pamahalaan, mga komunikasyon, pagkawala ng kuryente, o hindi gumagana ang kagamitan o software (bawat isa ay isang \\"Force Majeure Event\\".","15.6. Takdang-aralin. Hindi mo maaaring italaga o ilipat ang alinman sa iyong mga karapatan o obligasyon sa ilalim ng Mga Tuntuning ito nang walang paunang nakasulat na pahintulot mula sa Kumpanya, kabilang ang sa pamamagitan ng pagpapatakbo ng batas o kaugnay ng anumang pagbabago ng kontrol. Maaaring italaga o ilipat ng kumpanya ang anuman o lahat ng mga karapatan nito sa ilalim ng Mga Tuntuning ito, sa kabuuan o bahagi, nang hindi kinukuha ang iyong pahintulot o pag-apruba."]}]}')
